  const [data,setData]=useState();

  const getVideos=async()=>{
    const tdata=await fetch(YOUTUBE_VIDEOS_API);
    const jsonData= await tdata.json();

    console.log(jsonData);

    return jsonData.items
  }

  useEffect(()=>{
    setData(getVideos());
  },[])

  return (
    <div>
      <VideoCard info={data}/>
    </div>
  )
}

export default VideoContainer
